package leetCode.easy;

import org.junit.Test;

import static org.hamcrest.CoreMatchers.is;
import static org.junit.Assert.*;

public class CountBinarySubstringsTest {

    CountBinarySubstrings countBinary = new CountBinarySubstrings();
    @Test
    public void countBinarySubstrings() {
        assertThat(countBinary.countBinarySubstrings("00110011"), is(6));
        assertThat(countBinary.countBinarySubstrings("10101"), is(4));
        assertThat(countBinary.countBinarySubstrings("000101"), is(3));

        long start = System.currentTimeMillis();
        assertThat(countBinary.countBinarySubstrings("")
                , is(31236));
        long end = System.currentTimeMillis() - start;
        System.out.println("times" + end);
    }
}